import React from 'react';
import styled from 'styled-components';
import NaverLogin from 'react-naver-login';
import naverLogin from '../../build/static/images/네이버 아이디로 로그인_완성형_White.PNG';
import key from '../../key.json';
const LoginButton = styled.div`
    position : relative;
    background-image : url(${naverLogin});
    background-size : cover;
    background-position: center;
    background-repeat: no-repeat;
    outline : none;
border: none;
width: 300px;
height : 49px;
left : 15%;
margin-bottom : 1.5rem;
`;


const NaverLoginButton = ({responseNaver,responseNaverFail}) => {
    return(
    
        <NaverLogin clientId={key.naverKey}
                render={(props)=><LoginButton onClick={props.onClick}></LoginButton>}
                callbackUrl="http://localhost:3000/auth/login"
                onSuccess={responseNaver}
                onFailure={responseNaverFail}
                />
   
    );
    }
    export default NaverLoginButton;
